import styled from "styled-components";

export const Container = styled.div``;

export const ProductRegisterInput = styled.input`
  width: 100%;
  padding: .5rem;
  margin: 10px;
  border-radius: 12px;
  outline: none;
  background-color: transparent;
  border: 2px solid var(--accent-color);
`;
